import React from 'react'

const BlogPart = () => {
  return (
    <div className='col-3'>
        <div className='blog-part'>
            <div className='part-image'>
                <img  src="images/blog-1.jpg" alt="blog"/>

            </div>
        </div>
    </div>
  )
}

export default BlogPart
